
package proteins

import org.scalatest.{Matchers, FlatSpec}

class SimpleRNAChainToProteinTranslationSpec extends FlatSpec with Matchers {

  "RNA" should "be translated to Protein_example" in {
    val input:RNA = new RNA(DNADirection.FIVE_TO_THREE, "AUGGCCAUGGCGCCCAGAACUGAGAUCAAUAGUACCCGUAUUAACGGGUGA")

    assertResult("MAMAPRTEINSTRING")(input.toProteinString())
  }


  "RNA" should "be translated to Protein_testCase" in {
    val input:RNA = new RNA(DNADirection.FIVE_TO_THREE, "")
    val output:String = input.toProteinString()
    assertResult("")(output)
  }

}
